import React from 'react';
import { Link } from 'react-router-dom';
import styles from '../styles/HomePage.module.scss';
import { IoMdCart } from 'react-icons/io'; // Importing the cart icon from react-icons

const HomePage = () => {
  return (
    <div className={styles.header}>
      <div className={styles.logoContainer}>
        <img alt="Chemi Logo" className={styles.logo} />
        <span className={styles.logoText}>Chem Cart</span>
      </div>
      <input className={styles.searchInput} type="text" placeholder="Search..." />
      <div className={styles.loginLink}>
        <Link to="/login">Login</Link>
      </div>
      <div className={styles.cartIcon}>
        <Link to="/cart"><IoMdCart size="1.5em" /></Link> {/* Cart icon with a link to the cart page */}
      </div>
    </div>
  );
}

export default HomePage;
